backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

modules/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.vpc_cidr
  enable_dns_support   = true
  enable_dns_hostnames = true

  tags = {
    Name = "main-vpc"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.public_subnets_cidrs)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = var.public_subnets_cidrs[count.index]
  map_public_ip_on_launch = true

  tags = {
    Name = "public-subnet-${count.index}"
  }
}

resource "aws_internet_gateway" "default" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "main-igw"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.default.id
  }

  tags = {
    Name = "public-route-table"
  }
}

resource "aws_route_table_association" "public" {
  count = length(var.public_subnets_cidrs)

  subnet_id      = aws_subnet.public[count.index].id
  route_table_id = aws_route_table.public.id
}

modules/vpc/variables.tf.code:
variable "vpc_cidr" {
  type        = string
  description = "The CIDR block for the VPC."
}

variable "public_subnets_cidrs" {
  type        = list(string)
  description = "The list of CIDR blocks for the public subnets."
}

modules/vpc/outputs.tf.code:
output "vpc_id" {
  value       = aws_vpc.main.id
  description = "The ID of the VPC."
}

output "public_subnets_ids" {
  value       = aws_subnet.public[*].id
  description = "The IDs of the public subnets."
}

modules/ec2/main.tf.code:
resource "aws_launch_configuration" "app" {
  name_prefix            = "app-"
  image_id               = var.ami_id
  instance_type          = var.instance_type
  user_data              = file("${path.module}/user_data.sh")
  security_groups        = [aws_security_group.app_sg.id]

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "app_asg" {
  launch_configuration    = aws_launch_configuration.app.id
  vpc_zone_identifier     = var.subnets
  max_size                = var.asg_max_size
  min_size                = var.asg_min_size
  desired_capacity        = var.asg_desired_capacity
  health_check_type       = "ELB"
  load_balancers          = [aws_elb.app_lb.name]
  tag {
    key                 = "Name"
    value               = "app-instance"
    propagate_at_launch = true
  }
}

resource "aws_security_group" "app_sg" {
  name        = "app-sg"
  description = "Security group for App instances"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_elb" "app_lb" {
  name               = "app-load-balancer"
  subnets            = var.subnets
  security_groups    = [aws_security_group.app_sg.id]

  listener {
    instance_port     = 80
    instance_protocol = "http"
    lb_port           = 80
    lb_protocol       = "http"
  }

  health_check {
    healthy_threshold   = 2
    unhealthy_threshold = 2
    timeout             = 3
    interval            = 30
    target              = "HTTP:80/"
  }
}

modules/ec2/variables.tf.code:
variable "ami_id" {
  description = "The AMI ID for the EC2 instances."
}

variable "instance_type" {
  description = "The instance type for the EC2 instances."
  default     = "t2.micro" # You can change this default as needed
}

variable "subnets" {
  type        = list(string)
  description = "A list of subnet IDs to launch resources in"
}

variable "vpc_id" {
  description = "The VPC ID where the resources will be created."
}

variable "asg_max_size" {
  description = "The maximum size of the autoscaling group."
}

variable "asg_min_size" {
  description = "The minimum size of the autoscaling group."
}

variable "asg_desired_capacity" {
  description = "The desired capacity of the autoscaling group."
}

modules/ec2/outputs.tf.code:
output "app_asg_name" {
  value       = aws_autoscaling_group.app_asg.name
  description = "The name of the autoscaling group."
}

output "app_load_balancer_dns_name" {
  value       = aws_elb.app_lb.dns_name
  description = "The DNS name of the application load balancer."
}

output "app_security_group_id" {
  value       = aws_security_group.app_sg.id
  description = "The ID of the application security group."
}

main.tf.code:
module "vpc" {
  source             = "./modules/vpc"
  vpc_cidr           = "10.0.0.0/16"
  public_subnets_cidrs = ["10.0.1.0/24", "10.0.2.0/24"]
}

module "ec2" {
  source              = "./modules/ec2"
  ami_id              = "ami-0b0ea68c435eb488d"
  instance_type       = "t2.micro"
  subnets             = module.vpc.public_subnets_ids
  vpc_id              = module.vpc.vpc_id
  asg_max_size        = 3
  asg_min_size        = 1
  asg_desired_capacity = 2
}

output "application_url" {
  value       = "http://${module.ec2.app_load_balancer_dns_name}"
  description = "URL to access the application"
}
